import Home from "../components/Pages/Home";
import Cursus from '../components/Pages/Cursus';
import Loisirs from '../components/Pages/Loisirs';

const menu = [
	{title: 'Home', route: '/portfolio/', component: Home, public: true},
	{title: 'Compétences', route: '/portfolio/competences', component: Cursus, public: true},
	{title: 'Loisirs', route: '/portfolio/loisirs', component: Loisirs, public: true},
]
export default menu;
